import React from 'react'
import franklin from '../images/franklin.jpeg'; 
import '../index.css';

export default function Nav() {
    return (
        <div>
            <ul className="nav-ul">
                <li><img className="franklin" src={franklin} /></li>
                <li>SPORTS</li>
                <li>FAMILY GAMES</li>
                <li>FAN SHOP</li>
                <li>SALE</li>
                <li>GIFT CARDS</li>
                <li>CUSTOM BATTING GLOVES</li>
                <li><ion-icon ios="ios-search" md="md-search"></ion-icon></li>
            </ul>
        </div>
    )
}
